const {ipcRenderer} = require('electron');
      ipcRenderer.on('message', function(event, text,err) {
            if(err) {
                  console.error(err);
            }
      var m = document.getElementById('messages');
      m.innerHTML = text;
});
window.addEventListener('DOMContentLoaded', () => {
      //document.title = 'GitApp - ' + require('./package.json').version;
      const customTitlebar = require('custom-electron-titlebar');
      
      if(document.width > 400) {
            const titlebar = new customTitlebar.Titlebar({
                  backgroundColor: customTitlebar.Color.fromHex('#24292e'),
            });
            titlebar.updateTitle('GitApp - ' + require('./package.json').version);
            const bar = document.getElementsByClassName("titlebar")[0];
            bar.innerHTML = bar.innerHTML + `
            <a style="margin-top:0.1rem" id="back">
            <img style="width:12px" src="data:image/png;base64,">
            </a>
            <a style="margin-top:0.1rem; margin-left: 10px" id="forward">
            <img style="width:12px" src="data:image/png;base64,">
            </a>
            `;
            document.getElementById("back").onclick = function (e) {
            e.preventDefault();
            window.history.back();
            }
            document.getElementById("forward").onclick = function (e) {
            e.preventDefault();
            window.history.forward();
            }
      }
})